import ReactDOM from "react-dom/client";
import useFetch from "./useFetch";

const Home = () => {
  const [data] = useFetch("localhost:8080/flashcards");

  return (
    <>
      {data &&
        data.map((item) => {
          return <p key={item.frontside}>{item.backside}</p>;
        })}
    </>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Home />);
